import MainContent from './componenst/MainContent';
import data from './componenst/data';
import './App.css';
import { useState } from 'react';
import React from 'react';


function App() {




  const sisu = data.map((item, index) => (
    <MainContent
      key={index}
      name={item.name}
      text={item.text}
      date={item.date}
      img={item.img}
      data={data}
    />
  ));
  const lisa = () => {
    return (
      <div>
        {data.map((item, index) => (
          <div key={index}>
            <p>{item.name}</p>
            <p>{item.date}</p>
          </div>
        ))}
      </div>
    );
  };
  const [count, setCount] = React.useState(0)

  const add = () => {
    setCount(count + 1)
  }
  const subs = () => {
    setCount(count - 1)
  }

  return (
    <div className="App">
      <div>Calculator
        <p>{count}</p>
        <button onClick={add}>Add</button>
        <button onClick={subs}>substract</button>
      </div>
      <button onClick={lisa}>Lisa andmed</button>
      {lisa()}
      {sisu}

    </div>
  );
}

export default App;
